import styled from "styled-components";
import { Link } from "react-scroll";

export const Button = styled(Link)`
  border-radius: 50px;
  white-space: nowrap;
  background: ${({ primary }) => (primary ? "#7bca57" : "#25835c")};
  padding: 20px;
`;
